import React from "react";
import "./SuggestionProfile.css"
import { Avatar } from "@mui/material";

const SuggestionProfile=()=>{
    return(
        <>
            <div className="suggested_profile">
            <div className="profile_info">
             <Avatar  src="https://images.unsplash.com/photo-1565288971009-a6db8844c687?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDl8aG1lbnZRaFVteE18fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=600&q=60" className="profile_logo">s</Avatar>
             <div className="profile_description">
              <p className="profile_name">SudhaGurung</p> 
              <p className="follower">Followed by  taragurung +12 more</p>
             </div>
             
             </div>
            <div className="view">
              <a href="#">Follow</a>
            </div>
            
            </div>
            
        </>
    );
}

export default SuggestionProfile;
